import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    <div className="flex flex-col w-52 h-screen fixed top-0 left-0 bg-neutral z-10 p-4">
      <NavLink className="btn btn-ghost normal-case text-xl" to="/">Roster</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/employeeform">Add Associate</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/executivesummary">Executive Summary</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/about">About</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/associatetable">Associate Schedules</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/schedulebuilder">Schedule Build Optimizer</NavLink>
      <NavLink className="btn btn-ghost normal-case text-xl" to="/allocationsummary">Department Allocation Optimizer</NavLink>
    </div>
  );
}

export default NavBar;
